(SELECT random_number_cte.[KEY] AS [KEY], CASE WHEN (random_number_cte.uniform <= 0.245) THEN 0 ELSE CASE WHEN (random_number_cte.uniform <= 0.49375) THEN 1 ELSE CASE WHEN (random_number_cte.uniform <= 0.74625) THEN 2 ELSE CASE WHEN (random_number_cte.uniform <= 1.0) THEN 3 END END END END AS multinomial_expr 
FROM random_number_cte), 
dummy_class_reg_cte AS 
(SELECT multinomial_cte.[KEY] AS [KEY], 0.245 AS [Proba_0], CASE WHEN (0.245 IS NULL OR 0.245 > 0.0) THEN log(0.245) ELSE -1.79769313486231e+308 END AS [LogProba_0], 0.24875 AS [Proba_1], CASE WHEN (0.24875 IS NULL OR 0.24875 > 0.0) THEN log(0.24875) ELSE -1.79769313486231e+308 END AS [LogProba_1], 0.2525 AS [Proba_2], CASE WHEN (0.2525 IS NULL OR 0.2525 > 0.0) THEN log(0.2525) ELSE -1.79769313486231e+308 END AS [LogProba_2], 0.25375 AS [Proba_3], CASE WHEN (0.25375 IS NULL OR 0.25375 > 0.0) THEN log(0.25375) ELSE -1.79769313486231e+308 END AS [LogProba_3], multinomial_cte.multinomial_expr AS [Decision] 
FROM multinomial_cte)
 SELECT dummy_class_reg_cte.[KEY] AS [KEY], CAST(NULL AS FLOAT) AS [Score_0], CAST(NULL AS FLOAT) AS [Score_1], CAST(NULL AS FLOAT) AS [Score_2], CAST(NULL AS FLOAT) AS [Score_3], dummy_class_reg_cte.[Proba_0] AS [Proba_0], dummy_class_reg_cte.[Proba_1] AS [Proba_1], dummy_class_reg_cte.[Proba_2] AS [Proba_2], dummy_class_reg_cte.[Proba_3] AS [Proba_3], dummy_class_reg_cte.[LogProba_0] AS [LogProba_0], dummy_class_reg_cte.[LogProba_1] AS [LogProba_1], dummy_class_reg_cte.[LogProba_2] AS [LogProba_2], dummy_class_reg_cte.[LogProba_3] AS [LogProba_3], CAST(NULL AS INTEGER) AS [Decision], CAST(NULL AS FLOAT) AS [DecisionProba] 
FROM dummy_class_reg_cte